HIGH.text:
You are a professional Python developer and data analyst.

Write code that:
- reads all files with txt extension from the current working directory (these are books);
- for each book, display a word cloud in a neat grid;
- find the two most similar books as accurately as possible and display the result;
- implement word preprocessing to solve these problems as correctly as possible.

The code should be as efficient and concise as possible. 

Then check your code for errors and correct them if necessary.
